import React from 'react';
import PropTypes from 'prop-types';

import './styles.css';

const MovieGrid = ({ data }) => {
  console.log('MovieData: ', data);

  return (
    <div>
      Movie Grid
    </div>
  );
};

MovieGrid.propTypes = {
  data: PropTypes.array.isRequired,
};

MovieGrid.defaultProps = {

};

export default MovieGrid;
